//calls cprr and evaluates gi using fi
unsigned int *g(unsigned int shares[], unsigned int d, unsigned int j){
	// computing g1
	if(j ==1){
		unsigned int *g1ans = cprr(shares,d,f1);
		return g1ans;
	}
	//computing g2
	else if(j == 2){
		unsigned int *g1temp = cprr(shares ,d, f1);
		unsigned int *g2ans = cprr(g1temp,d,f2); 
		return g2ans;		
	}
}

